import React from "react";
import { handleDeleteOperation } from "../../general_compo/reusable_operations/delete_operation/DeleteOperation";
import { deleteBrandService } from "../../../services/CRUD_categoryService";
import { useEffect } from "react";

export const Operations_brands = ({
  rowData,
  data,
  setData,
  brandToEdit,
  setBrandToEdit,
}) => {
  useEffect(() => {
    console.log("Operations_brands");
    console.log(rowData);
    //console.log(brandToEdit);
  }, []);
  return (
    <div>
      <i
        className="icon_product_table fas fa-edit text-warning mx-1 pointer has_tooltip"
        title="ویرایش محصول"
        data-bs-placement="top"
        data-bs-toggle="modal"
        data-bs-target="#add-brand-modal"
        onClick={() => {
          //console.log(rowData);
          setBrandToEdit(rowData);
        }}
      ></i>

      <i
        className="icon_product_table fas fa-times text-danger mx-1 pointer has_tooltip"
        title="حذف محصول"
        onClick={() => {
          handleDeleteOperation(rowData.id, data, setData, deleteBrandService);
        }}
      ></i>
    </div>
  );
};
